Youth Lagoon - The Knower (2015)

MP3, encoded at 320 but source bitrate is unknown.  Quality-wise it sounds to be at least 224 source.


This is the third track from Youth Lagoon's upcoming (at the time of this upload) 
album &quot;Savage Hills Ballroom&quot;. I bother to upload a single song because the full album will not be released for two months, in late September 2015.



All tracks will have correct ID3 tags.

All albums will have album art included if it was available to me.

